import React from 'react';
import bgError from 'src/assets\img\general\bg-error.png';

function ErroModal() {
    return(
        <div className="false-clicked-modal">
            <img src={bgError} alt="false-clicked" className="false-clicked-ing"/>
        </div>
    );
}

export default ErroModal;
